import React from 'react';
import FreelancerCard from './FreelancerCard.js';
import PropTypes from 'prop-types';
import CardDeck from 'react-bootstrap/CardDeck';
import {Container, Row} from 'react-bootstrap';


const { search } = window.location;
const query = new URLSearchParams(search).get('s');

const filterFreelancers = (freelancer_info, query) => {
  if (!query) {
      return freelancer_info;
  }

  return freelancer_info.filter((freelancer) => {
      // const freelancerTest = <FreelancerCard
      //                           key={freelancer.id}
      //                           freelancer={freelancer} />
      const freelancerName = freelancer.name.toLowerCase();
      return freelancerName.includes(query);
  });
};

class FreelancerList extends React.Component {

  render() {
    return (
      <Container fluid>
        <Row className ="justify-content-md-center">

          <CardDeck style={{display: 'flex'}}>
            {
              // this.props.freelancer_info.map(freelancer => (
              //   <FreelancerCard
              //     key={freelancer.id}
              //     freelancer={freelancer} />
              // ))

              filterFreelancers.map(freelancer => (
                  // <FreelancerCard
                  //   key={freelancer.id}
                  //   freelancer={freelancer} />
                  freelancer
                ))

            }
            </CardDeck>
          </Row>
      </Container>      
    );
  }
}

FreelancerList.propTypes = {
  freelancer_info: PropTypes.arrayOf(PropTypes.object).isRequired
};

FreelancerList.defaultProps = {
  freelancer_info: []
};

export default FreelancerList;
